import styled from 'styled-components';
export const ContentBlock = styled.div`
  width: 100%;
  height: 100%;
`;

export const ContentItemHeader = styled.div`
  height: 5%;
  background-color: #00b7ff;
`;

export const ContentItemBody = styled.div`
  background-color: gray;
  height: 95%;
`;
